const Field = (props) => {
  const { value, header } = props;

  if (!value) {
    return <></>;
  }

  return (
    <div>
      <div className="field-label">
        {header}
        <div title={value} className="field-value">
          {value}
        </div>
      </div>
    </div>
  );
};

export default Field;
